INSERT INTO `summary` VALUES ('2110001', '2022-01-05', '我积极关注学生的学习和生活情况，与他们建立了良好的师生关系，促进了班级的团结和发展。');
INSERT INTO `summary` VALUES ('2110001', '2022-06-15', '我与家长保持紧密沟通，了解学生在家庭环境中的情况，并及时解决问题，得到了家长的高度认可和支持。');
INSERT INTO `summary` VALUES ('2110001', '2023-01-08', '我认真管理班级的日常事务，维持了良好的学习秩序和班级氛围，学生的纪律意识和学习效果有了明显提升。');
INSERT INTO `summary` VALUES ('2110001', '2023-06-20', '我关注学生的心理健康，积极开展心理辅导和疏导工作，帮助他们解决了一些困扰和压力问题。');
INSERT INTO `summary` VALUES ('2110002', '2022-01-05', '我与学科教师密切合作，制定了科学的班级学科教学计划，推动了学科教育的全面发展。');
INSERT INTO `summary` VALUES ('2110002', '2022-06-15', '我组织了丰富多彩的班级文体活动，增强了学生的课余生活品质，同时也加强了班级凝聚力和集体荣誉感。');
